  false,\n\t\"url\": null,\n\t\"notes\": \"The New York State Canal System is a 524
  mile inland waterway that includes 20 guard gates, which are used to close off a
  section of canal seasonally or in rare instances in an emergency so that a section
  can be dewatered. Information provided in this data set includes the name of each
  guard gate, its phone number (where applicable), and specific location by mileage
  along the canal and geographic coordinates.\",\n\t\"license_title\": \"License Not
